import request from '@/utils/request'

const base = `/supply`

export default {
    add(supplier) {
        return request({
            url: `${base}/add`,
            method: 'post',
            data: supplier
        })
    },
    page(current, size) {
        return request({
            url: `${base}/${current}/${size}`,
            method: 'get',
        })
    },
    deleteData(id) {
        return request({
            url: `${base}/${id}`,
            method: 'delete'
        })
    }
}
